import React from 'react';


const Practice = ({city, search, setSearch}) => {
    return (
        <>
        <div>
        <input 
        type="search"
        placeholder="search city name"
        value={search}
        onChange={(event)=>{ setSearch(event.target.value)  }}
        />
        </div>

        <div>
          <h2>{search}</h2>
          <h3>{city.temp}</h3>
          <h3>min: {city.temp_min} and max: {city.temp_max}</h3>
        </div>
        
        </>
    )
}

export default Practice
